pragma solidity ^0.8.6;

contract SeatContract {

  uint seatCounter = 0;

  event SeatCreated (
    uint id,
    string row,
    string column,
    bool inUse
  );

  struct Seat {
    uint id;
    string row;
    string column;
    bool inUse;
  }

  constructor () {
    createSeat("1", "A");
    createSeat("1", "B");
    createSeat("1", "C");
    createSeat("1", "D");
    createSeat("1", "E");
    createSeat("1", "F");
    createSeat("1", "G");
    createSeat("1", "H");
    createSeat("1", "I");
    createSeat("1", "J");
    createSeat("1", "K");
    createSeat("1", "L");
    
    createSeat("2", "A");
    createSeat("2", "B");
    createSeat("2", "C");
    createSeat("2", "D");
    createSeat("2", "E");
    createSeat("2", "F");
    createSeat("2", "G");
    createSeat("2", "H");
    createSeat("2", "I");
    createSeat("2", "J");
    createSeat("2", "K");
    createSeat("2", "L");
    
    // createSeat("3", "A");
    // createSeat("3", "B");
    // createSeat("3", "C");
    // createSeat("3", "D");
    // createSeat("3", "E");
    // createSeat("3", "F");
